t":420,"width":420}},"output_type":"display_data"}],"source":["# Visualising the Test set results\n","library(Rfast)\n","set = test_set\n","X1 = seq(min(set[, 1]) - 1, max(set[, 1]) + 1, by = 0.01)\n","X2 = seq(min(set[, 2]) - 1, max(set[, 2]) + 1, by = 0.01)\n","grid_set = expand.grid(X1, X2)\n","colnames(grid_set) = c('Age', 'EstimatedSalary')\n","prob_set = predict(classifier, type = 'response', newdata = grid_set)\n","y_grid = ifelse(prob_set > 0.5, 1, 0)\n","plot(set[, -3],\n","     main = 'Logistic Regression (Test set)',\n","     xlab = 'Age', ylab = 'Estimated Salary',\n","     xlim = range(X1), ylim = range(X2))\n","contour(X1, X2, matrix(as.numeric(y_grid), length(X1), length(X2)), add = TRUE)\n","points(grid_set, pch = '.', col = ifelse(y_grid == 1, 'springgreen3', 'tomato'))\n","points(set, pch = 21, bg = ifelse(set[, 3] == 1, 'green4', 'red3'))"]},{"cell_type":"code","execution_count":18,"id":"48e39965","metadata":{"execution":{"iopub.execute_input":"2022-03-12T22:30:17.034691Z","iopub.status.busy":"2022-03-12T22:30:17.033207Z","iopub.status.idle":"2022-03-12T22:30:17.258437Z","shell.execute_reply":"2022-03-12T22:30:17.259319Z"},"papermill":{"duration":0.329563,"end_time":"2022-03-12T22:30:17.259569","exception":false,"start_time":"2022-03-12T22:30:16.930006","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xV9fkH8Hd2wo5MxQWodYsDBSwqigMUZ53VurXyc1SttbZqHdVqq6K2Vq0L\nd2vdg+XADdoKFnFbUbQONjJDSPL7I0YTSDCQcW7ufd5/8OL1nHvP+dzc77n3uWdmVVRUCCGE\nEEIILV920gFCCCGEEELjiMYuhBBCCCFNRGMXQgghhJAmorELIYQQQkgT0diFEEIIIaSJaOxC\nCCGEENJENHYhhBBCCGkiGrsQQgghhDQRjV0IIYQQQpqIxi6EEEIIIU1EYxdCCCGEkCaisQsh\nhBBCSBPR2IUQQgghpIlo7EIIIYQQ0kQ0diGEEEIIaSIauxBCCCGENBGNXQghhBBCmojGLoQQ\nQgghTURjF0IIIYSQJqKxCyGEEEJIE9HYhRBCCCGkiWjsQgghhBDSRDR2IYQQQghpIhq7EEII\nIYQ0EY1dCCGEEEKaiMYuhBBCCCFNRGMXQgghhJAmorELIYQQQkgT0diFEEIIIaSJaOxCCCGE\nENJENHYhhBBCCGkiGrsQQgghhDQRjV0IIYQQQpqIxi6EEEIII